import React from 'react';
import Swiper1 from './Swiper1';
import Swiper2 from './Swiper2';

const Services =() => {

	return ( 
		<>
			
			<div className="row bg-dark w-100">
				<div className="col-10 bg-warning mx-auto">
					
					<div className="row">
						<Swiper1 />
					</div><br />
					<div className="row">
						<Swiper2 />
					</div>
			
				</div>
			</div>
		</>
		);
};

export default Services;
